import React, { Component } from "react";
import { Layout, Navigation, Drawer, Header, Content } from "react-mdl";
import Main from "./Components/Main";
import "./App.css";
import { Link } from "react-router-dom";

class App extends Component {
  render() {
    return (
      <div className="App">
        <link
          rel="icon"
          href="https://www.shareicon.net/download/2016/08/01/640324_logo_512x512.png"
          type="image/gif"
          sizes="16x16"
        />
        <div className="demo-big-content">
          <Layout>
            <Header className="Header-color" title="DevIdentity" scroll>
              <Navigation>
                <Link to="/Projects">Projects</Link>
                <Link to="/contactus">Contact Us</Link>
              </Navigation>
            </Header>
            <Drawer title="DevIdentity">
              <Navigation>
                <Link to="/Projects">Projects</Link>
                <Link to="/contactus">Contact Us</Link>
              </Navigation>
            </Drawer>
            <Content>
              <div className="page-content" />
              <Main />
            </Content>
          </Layout>
        </div>
      </div>
    );
  }
}

export default App;
